import React from 'react';
import { Link } from 'react-router-dom'; // Import Link from react-router-dom

function Footer() {
  return (
    <footer className="bg-dark text-light py-8">
      <div className="container mx-auto px-6 md:px-12 lg:px-24 flex justify-between items-center">
        {/* Copyright notice */}
        <p>&copy; {new Date().getFullYear()} AnswerMillion.<br/> All Rights Reserved.</p>

        {/* Links */}
        <div>
          <Link to="/terms" className="font-medium mr-4">Terms</Link>
          <Link to="/privacy" className="font-medium">Privacy</Link>
        </div>
      </div>
    </footer>
  );
}

export default Footer;
